import React from 'react';
import './Game.css';
import startMariopic from '../../marioPics/startMario.png';
import cloudsImage from '../../marioPics/cloud.png';
import pipeImg from '../../marioPics/pipe.png';
import '../Game/Game';
 
const mario = document.getElementsByClassName('.mario');
const pipe = document.getElementsByClassName('.pipe'); 
const startMarioButton = document.getElementsByClassName('.start-mario');

const Game = () => {
  return (
    <div className='game-board'>
      <img
        src={startMariopic}
        alt='start'
        className='start-mario'
        id='startt'
        onClick={startMario(mario, pipe, startMarioButton)}
      />
      <img src={cloudsImage} alt="clouds" class="clouds"></img>
      <img src={pipeImg} className='pipe' alt='mario-pipe' />
      <img
        src='https://gamerview.uai.com.br/wp-content/uploads/2019/12/mario-gif.gif'
        className='mario'
        alt='marioo'
      />
    </div>
  );
};

export default Game;
